import './App.css';
import Navbar from './Components/Navbar/Navbar';
import Content from './Components/Content/Content';
import { Container } from 'react-bootstrap';

function App() {
  return (
    <div className="App">
      <Container>
        <Navbar/>
        <Content/>
      </Container>
    </div>
  );
}

export default App;
